import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Main />
      </div>
    );
  }
}

class Main extends Component{
  render() {
    return(
      <div className='main'>
        <Buttons />

      </div>
    )
  }
}

function MainButton(props) {
  return(
    <button className='buttons'>{props.name}</button>
  )
}

